import React from "react";
import Button from "react-bootstrap/es/Button";
import axios from "axios";
import { withRouter } from "react-router-dom";
import LoadingSpinner from "pnnl-react-core/lib/Loader";
import data from "./ExamplesSpds.json";

class Examples extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      example_number: "",
      loading: false,
      data: [],
      tableReady: false,
      disabled: true
    };
    this.handleSubmit = this.handleSubmit.bind(this);
    this.handleChange = this.handleChange.bind(this);
  }
  handleSubmit(event) {
    if (this.state.example_number !== "") {
      var exSpd = [];
      var i;
      for (i = 0; i < 401; i++) {
        exSpd.push(data.data[i][this.state.example_number]);
      }
      console.log(exSpd);
      event.preventDefault();
      this.setState({ loading: true }, () => {
        axios.defaults.headers.common = {};
        axios.defaults.headers.common.accept = "application/json";
        axios
          .post("http://dtn3.pnl.gov:8080/api/tm30Paste", {
            info: exSpd
          })
          .then(res => {
            return res.data;
          })
          .then(data => {
            //console.log(data.data);
            this.setState({
              loading: false,
              data: data.data,
              tableReady: true
            });
            /**
             * Not Really Used anymore but still could be used later
             */
            //localStorage.setItem("data", JSON.stringify(this.state.data));
            /**
             * Pushes the data to the Reports page and redirects to that page
             */
            this.props.history.push({
              pathname: "/Report",
              state: {
                data: this.state.data
              }
            });
          });
      });
    }
  }
  handleChange(event) {
    if (event.target.value === "") {
      this.setState({ example_number: event.target.value, disabled: true });
    } else {
      this.setState({ example_number: event.target.value, disabled: false });
    }
    console.log(this.state.example_number);
  }
  render() {
    const loading = this.state.loading;
    let examples = [
      "CIE F1",
      "CIE F2",
      "CIE F3",
      "CIE F4",
      "CIE F5",
      "CIE F6",
      "CIE F7",
      "CIE F8",
      "CIE F9",
      "CIE F10",
      "CIE F11",
      "CIE F12",
      "F32T8/930",
      "F32T8/950",
      "F34T12/CW/RS/EW",
      "F34T12/LW/RS/EW",
      "F34T12/WW/RS/EW",
      "F40T12/C50 (1)",
      "F40T12/C50 (2)",
      "F40T12/C75 (1)",
      "F40T12/C75 (2)",
      "F40T12/CWX (1)",
      "F40T12/CWX (2)",
      "F40T12/DX (1)",
      "F40T12/DX (2)",
      "F40T12/DXTP (1)",
      "F40T12/DXTP (2)",
      "F40T12/N (1)",
      "F40T12/N (2)",
      "F32T8/730",
      "F32T8/735",
      "F32T8/741",
      "F32T8/750",
      "F32T8/830 (1)",
      "F32T8/830 (2)",
      "F32T8/830 (3)",
      "F32T8/835 (1)",
      "F32T8/835 (2)",
      "F32T8/835 (3)",
      "F32T8/841 (1)",
      "F32T8/841 (2)",
      "F32T8/841 (3)",
      "F32T8/850 (1)",
      "F32T8/850 (2)",
      "F32T8/850 (3)",
      "F32T8/865 (1)",
      "F32T8/865 (2)",
      "F40T12/30U",
      "F40T12/35U",
      "F40T12/41U"
    ];
    let optionItems = examples.map(example => (
      <option key={example} value={example}>
        {example}
      </option>
    ));

    return (
      <form onSubmit={this.handleSubmit}>
        <select value={this.state.example_number} onChange={this.handleChange}>
          <option value="">Choose an Example</option>
          {optionItems}
        </select>
        <br />
        {loading ? (
          <div>
            <label>
              {" "}
              Calculating Results <br />{" "}
              <LoadingSpinner color="copper" size={6} />{" "}
            </label>
          </div>
        ) : (
          <Button bsSize="sm" type="submit" disabled={this.state.disabled}>
            Calculate
          </Button>
        )}
        {/*this.state.tableReady ? (
          <div>
            <br />
            <table>
              <thead>
                <tr>
                  <th>Wavelength</th>
                  <th>Power Value</th>
                </tr>
              </thead>
              <tbody>
                {/*this.state.data.map(function(item, key) {
                  return (
                    <tr key={key}>
                      <td>{item.wavelength}</td>
                      <td>{item.powerValue}</td>
                    </tr>
                  );
                })}
              </tbody>
            </table>
          </div>
        ) : (
          <div></div>
        )*/}
      </form>
    );
  }
}

export default withRouter(Examples);
